import banner from '../../assets/IMG.png'
import '../Banner/index.css'
import descriptions from'../../data/description.json'



function Banner() {


    return (
        <div className="banner">
        <img className="banner-image" src={ banner } alt="banner home page" />
        { descriptions.map((item) => {
          return (
            <div className="collapse-container" key={item.id}>
            <Collapse content={item.content} title={item.title}/>
            </div>
          )
        })}
            <h1 className="banner-text"> Chez vous, partout et ailleurs</h1>
        </div>
    )
}

export default Banner
